import "./NavBar.modules.css"
import { useDispatch } from "react-redux";
import { sortDogsByName, sortDogsByWeight } from "../../Redux/actions";

export default function NavBar() {
  const dispatch = useDispatch();

  const handleSortByNameAsc = () => {
    dispatch(sortDogsByName("asc"));
  };

  const handleSortByNameDesc = () => {
    dispatch(sortDogsByName("desc"));
  };

  const handleSortByWeightAsc = () => {
    dispatch(sortDogsByWeight("asc"));
  };

  const handleSortByWeightDesc = () => {
    dispatch(sortDogsByWeight("desc"));
  };

  return (
    <div className="NavBar">
      <button onClick={handleSortByNameAsc}>Sort by name (asc)</button>
      <button onClick={handleSortByNameDesc}>Sort by name (desc)</button>
      <button onClick={handleSortByWeightAsc}>Sort by weight (asc)</button>
      <button onClick={handleSortByWeightDesc}>Sort by weight (desc)</button>
    </div>
  );
}
